import React from 'react';
import {Container, Button, Box, TextField, FormControl} from '@mui/material';

class Home extends React.Component {
  render() {
    return (
      <div>
        <Container maxWidth="sm" style={{textAlign: "center"}}>
            <h1>Snooker Data Manager</h1>
            <p>Provide data for players and games</p>
            <FormControl sx={{ m: 1, flexGrow: 1}}>
                <Box display="flex" justifyContent="center" sx={{ m: 2 }}>
                    <TextField id="outlined-basic" label="Player" variant="standard" />
                </Box>
                <Button variant='contained'>Hello World</Button>
            </FormControl>
        </Container>
      </div>
    );
  }
}

export default Home;
